import{_ as t,c as a,o as e,a2 as o}from"./chunks/framework.C94oF1kp.js";const u=JSON.parse('{"title":"Хеш-таблицы с открытой адресацией.","description":"","frontmatter":{},"headers":[],"relativePath":"tasks/031.md","filePath":"tasks/031.md"}'),s={name:"tasks/031.md"},r=o('<h1 id="хеш-таблицы-с-открытои-адресациеи" tabindex="-1">Хеш-таблицы с открытой адресацией. <a class="header-anchor" href="#хеш-таблицы-с-открытои-адресациеи" aria-label="Permalink to &quot;Хеш-таблицы с открытой адресацией.&quot;">​</a></h1><h2 id="определение" tabindex="-1">Определение <a class="header-anchor" href="#определение" aria-label="Permalink to &quot;Определение&quot;">​</a></h2><p><strong>Хеш-таблицы с открытой адресацией</strong> — это структура данных, использующая хеширование для организации данных, где все элементы хранятся непосредственно в самой хеш-таблице. В отличие от метода цепочек, при открытой адресации коллизии разрешаются путем поиска другой свободной ячейки в таблице.</p><p><img src="https://lh7-us.googleusercontent.com/docsz/AD_4nXfdk4ijKjqeqhdMu1QJtQwGfJumjvWEdYlQ3BmSLNE-t7OpEE4ODBtbTBxMaTKWdOy9_LHcDepZr-5VypKMuOcCZCvwSMIZG0WARHSzPXXwQR_fL62tN4T15GcjWWUVpBvAz1CYK18Uy4WQ91nqIRyNMWy_?key=9gziK4gT-jwK64_BpOeehQ" alt=""></p><p><strong>При открытой адресации,</strong> если хеш-функция назначает элементу уже занятую ячейку, используется вторичный метод для нахождения другой свободной ячейки.</p><p>Основные методы открытой адресации:</p><ol><li><strong>Линейное пробирование (Linear Probing):</strong> Если ячейка занята, проверяются следующие ячейки по порядку.</li><li><strong>Квадратичное пробирование (Quadratic Probing):</strong> Используется квадратичная функция для поиска следующей ячейки.</li><li><strong>Двойное хеширование (Double Hashing):</strong> Применяется вторая хеш-функция для вычисления шага смещения.</li></ol>',7),n=[r];function i(_,c,l,d,p,h){return e(),a("div",null,n)}const m=t(s,[["render",i]]);export{u as __pageData,m as default};
